/**
* https://leetcode.com/problems/find-the-difference/
* error case:
* ""
* ""
*
*/

int a[26];
int b[26];

char findTheDifference(char * s, char * t){
    if (s == "") {
        return *t;
    }
    
    for(int i=0; i<26; ++i) {
        a[i] = 0;
        b[i] = 0;
    }
    char *p = s;
    while (*p != '\0') {
        a[*p-'a']++;
        p++;
    }
    char *q = t;
    while (*q != '\0') {
        b[*q-'a']++;
        q++;
    }
    for (int i=0; i<26; ++i) {
        if (a[i] == 0 && b[i] == 1) {
            return 'a'+i;
        }
    }
    return t[0];
    
}
